export default function Projects() {
  const [showModal, setShowModal] = useState(false);

  const handleModal = () => {
    setShowModal(!showModal);
  };

  return (
    <section>
      <div className="projects">
        <h2>Projects</h2>
        <p>Here are a few past projects I've worked on.</p>
      </div>
      <div className="container1">
        <div className="project shadow-lg" onClick={handleModal}>
          <p>Coming Soon</p>
        </div>
        <div className="project shadow-lg">
          <p>Coming Soon</p>
        </div>
        <div className="project shadow-lg">
          <p>Coming Soon</p>
        </div>
      </div>

       {showModal && (
        <div className="modal-background" onClick={handleModal}>
          <div className="modal" onClick={(e) => e.stopPropagation()}>
            <span className="close" onClick={handleModal}>
